{"cells":[{"source":"<a href=\"https://www.kaggle.com/elroyq/case-study-on-bellabeat?scriptVersionId=84872676\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"c1dca8ab","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.115304,"end_time":"2022-01-10T10:32:00.068087","exception":false,"start_time":"2022-01-10T10:31:59.952783","status":"completed"},"tags":[]},"source":["# <span style=\"color:#FA8072\"> Google Data Analytics Case study 2 (Bellabeat)\n","\n","## Introduction and background\n","This is a data analysis case study as part of an optional capstone project for the Google Data Analytics Professional Certificate on Coursera. It involves the scenario of a junior data analyst working at Bellabeat, a high-tech manufacturer of health-focused products for women. \n","\n","For the purposes of this project, this data analysis will follow the step-by-step process and format of Ask, Prepare, Process, Analyze, Share, Act phases taught in the course.\n","\n","This is a beginner analysis, please feel free to add suggestions in the comments.\n","\n","# <span style=\"color:#FA8072\"> Table of Contents </span>\n","\n","* [1. Ask Phase](#ask_phase_1)\n","    * [1.1 Key stakeholders](#key_stakeholders_1_1)\n","    * [1.2 Business task](#business_task_1_2)\n","    * [1.3 Details about business task](#details_task_1_3)\n","* [2. Prepare Phase](#prepare_phase_2)\n","    * [2.1 Analysing the dataset](#analyse_dataset_2_1)\n","    * [2.2 Data bias and credibility](#data_bias_credibility_2_2)\n","* [3. Process Phase](#process_phase_3)\n","    * [3.1 Installing and loading useful packages](#installing_loading_packages_3_1)\n","    * [3.2 Importing CSV files](#importing_csv_3_2)\n","    * [3.3 Preview the data](#preview_data_3_3)\n","    * [3.4 Cleaning and formatting](#cleaning_and_formatting_3_4)\n","    * [3.5 Merging data](#merging_data_3_5)\n","    * [3.6 Adding new variables](#adding_variables_3_6)\n","* [4. Analyze and Share Phase](#analyze_share_phase_4)\n","    * [4.1 Summary statistics](#summary_statistics_4_1)\n","    * [4.2 Activity level analysis](#activity_analysis_4_2)\n","    * [4.3 Activity level analysis by day of the week](#activity_analysis_week_4_3)\n","    * [4.4 Sleep analysis](#sleep_analysis_4_4)\n","    * [4.5 Sleep analysis by day of the week](#sleep_analysis_week_4_5)\n","    * [4.6 Time asleep vs Time in bed](#time_asleep_time_bed_4_6)\n","    * [4.7 Time asleep vs Total distance tracked](#time_asleep_total_distance_4_7)\n","    * [4.8 Calories expended vs Steps taken](#calories_steps_4_8)\n","* [5. Act Phase](#act_phase_5)\n","    * [5.1 Key recommendations](#key_recommendations_5_1)\n","    * [5.2 Limitations of analysis](#limitations_analysis_5_2)\n","    * [5.3 Considerations for future analysis](#considerations_future_5_3)\n","    "]},{"cell_type":"markdown","id":"01314d38","metadata":{"papermill":{"duration":0.114283,"end_time":"2022-01-10T10:32:00.296991","exception":false,"start_time":"2022-01-10T10:32:00.182708","status":"completed"},"tags":[]},"source":["## <span style=\"color:#FA8072\">  1. Ask Phase </span>  <a class=\"anchor\" id=\"ask_phase_2\"></a>\n","\n","### 1.1 Key stakeholders <a class=\"anchor\" id=\"key_stakeholders_1_1\"></a> \n","* Urška Sršen - Bellabeat cofounder and Chief Creative Officer \n","* Sando Mur - Bellabeat cofounder and key member of Bellabeat executive team \n","* Bellabeat Marketing Analytics team - Fellow data analysts\n","\n","### 1.2 Business Task <a class=\"anchor\" id=\"business_task_1_2\"></a> \n","To find patterns or trends in smart device usage data that can be used to make recommendations on marketing strategies for Bellabeat's smart device products.\n","\n","### 1.3 Details of business task <a class=\"anchor\" id=\"details_task_1_3\"></a> \n","Bellabeat is a tech-driven wellness company for women with multiple smart wellness products that track physical activity, sleep and stress. The products can be connected to the Bellabeat app for the user to access their data. There is also a Bellabeat subscription program that gives access to personalised guidance on health and wellness.The Chief Creative Officer has given the task to focus on one of Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. \n","\n","The products available are \n","* Leaf: Bellabeat’s classic wellness tracker can be worn as a bracelet, necklace, or clip. The Leaf tracker connects to the Bellabeat app to track activity, sleep, and stress.\n","* Time: This wellness watch combines the timeless look of a classic timepiece with smart technology to track user activity, sleep, and stress. The Time watch connects to the Bellabeat app to provide you with insights into your daily wellness.\n","* Spring: This is a water bottle that tracks daily water intake using smart technology to ensure that you are appropriately hydrated throughout the day. The Spring bottle connects to the Bellabeat app to track your hydration levels.\n","\n","For this case study, we will select Leaf as the product to focus on as it is the basic model that has features our dataset can contribute insights to.\n","\n","The Coursera case study details do not seem to be up to date with what Bellabeat is currently offering, it does not mention their newest product Ivy or additional information such as Leaf and Time tracking reproductive health. However, for the sake of simplicity we will use only the listed case study information.\n"]},{"cell_type":"markdown","id":"63c42d6b","metadata":{"papermill":{"duration":0.112636,"end_time":"2022-01-10T10:32:00.522453","exception":false,"start_time":"2022-01-10T10:32:00.409817","status":"completed"},"tags":[]},"source":["## <span style=\"color:#FA8072\"> 2. Prepare Phase </span> <a class=\"anchor\" id=\"prepare_phase_2\"></a> \n","\n","### 2.1 Analysing the dataset: <a class=\"anchor\" id=\"analyse_dataset_2_1\"></a> \n","\n","The dataset we are instructed to use is available on Kaggle, titled \"FitBit Fitness Tracker Data\" <https://www.kaggle.com/arashnic/fitbit>\n","\n","Metadata about the data types and descriptions is available at <https://www.fitabase.com/media/1930/fitabasedatadictionary102320.pdf>\n","\n","30 eligible Fitbit users consented to the submission of personal tracker data, including daily activity, steps, heart rate, calories, sleep. weight that can be used to explore users’ habits. Data is available as 18 CSV files, collected from 03/12/2016 - 05/12/2016 via survey by Amazon Mechanical Turk (crowdsourcing website for businesses).\n","\n","It is provided under a free license CC0 1.00 Public Domain, by an experienced Kaggle user \"Möbius\", therefore no restrictions from copywright or reliability of source (Second-party source).\n","\n","As mentioned by the stakeholder in the case study, finding another dataset would be useful if possible. Preferably a larger dataset with more details such as fitbit for each user for a deeper exploration of any possible differences. Considering the focus of Bellabeat on women as a customer base, a female only dataset would be ideal. This dataset should ideally be open source as well, considering this project's limitations (Simulated case study of a fictional scenario by an individual) \n","No suitable dataset was available after a search, so only the previously mentioned dataset will be used for now.\n","\n","### 2.2 Data bias and credibility:<a class=\"anchor\" id=\"data_credibility_and_integrity_2_2\"></a> \n","\n","There is a concern of a limited sample size, but 30 is the minimum number for a sample to represent the population by Central Limit Theorem. We will still proceed with this dataset.\n","\n","The data is from 2016 and only for 2 months as well. Also, the metadata file states that not all data are automatically recorded, some are manually input by the user. Data from self-input surveys might have concerns of integrity.\n","\n","According to the data source on Zenodo(a general-purpose open-access repository), variation between output represents use of different types of Fitbit trackers and individual tracking behaviors / preferences. This might pose a problem of inconsistency in data collection, even though Fitbit is a reputable activity tracker brand.\n","\n","Consent was given as the data was collected via surveys. Privacy is not a concern as identifiers are not present.\n","No data as well on relevant information such as participants' demographic characteristics, lifestyle, time location, weather indicators, activity tracker usage frequency.\n"]},{"cell_type":"markdown","id":"cc2f82d0","metadata":{"papermill":{"duration":0.127639,"end_time":"2022-01-10T10:32:00.762248","exception":false,"start_time":"2022-01-10T10:32:00.634609","status":"completed"},"tags":[]},"source":["# <span style=\"color:#FA8072\">  3. Process Phase </span> <a class=\"anchor\" id=\"process_phase_3\"></a> \n"," \n","This case study will be using R as it can not only perform each step of the data analysis process, it allows for easy sharing and reproducibilty of the analysis for others to see.\n","\n","### 3.1 Installing and loading useful packages <a class=\"anchor\" id=\"installing_loading_packages_3_1\"></a>"]},{"cell_type":"code","execution_count":1,"id":"194c8621","metadata":{"execution":{"iopub.execute_input":"2022-01-10T10:32:01.032212Z","iopub.status.busy":"2022-01-10T10:32:01.029087Z","iopub.status.idle":"2022-01-10T10:32:57.26036Z","shell.execute_reply":"2022-01-10T10:32:57.258816Z"},"papermill":{"duration":56.360699,"end_time":"2022-01-10T10:32:57.260561","exception":false,"start_time":"2022-01-10T10:32:00.899862","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.7\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.1.4     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.0.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n","Loading required package: gsubfn\n","\n","Loading required package: proto\n","\n","Warning message:\n","“no DISPLAY variable so Tk is not available”\n","Loading required package: RSQLite\n","\n"]}],"source":["install.packages(\"tidyverse\") #install the useful collection of R packages for data analysis \n","install.packages(\"janitor\") #package useful for data cleaning\n","install.packages(\"ggpubr\") #package with functions to help customise ggplot\n","install.packages(\"sqldf\") #package for running SQL statements on R data frames\n","library(tidyverse) #load the installed packages\n","library(janitor)\n","library(ggpubr)\n","library(sqldf)"]},{"cell_type":"markdown","id":"1e9f1a1b","metadata":{"papermill":{"duration":0.125549,"end_time":"2022-01-10T10:32:57.514077","exception":false,"start_time":"2022-01-10T10:32:57.388528","status":"completed"},"tags":[]},"source":["### 3.2 Importing CSV files <a class=\"anchor\" id=\"importing_csv_3_2\"></a>\n"," \n","The 18 CSV files have overlapping data and not all of it may be useful. We will upload the daily data and leave the hourly and minute-level data for later if there is a need. \n","\n","After looking through the CSV files in spreadsheets and the metadata, we can determine that the dailyActivity file is the most useful for daily data as it compiles the data for calories, steps and activity intensity.\n","The sleepDay file contains data on time asleep, time in bed and number of sleep periods exceeding 60 minutes that day. \n","The weightLogInfo file contains data on the users' weight."]},{"cell_type":"code","execution_count":2,"id":"a153b4b4","metadata":{"execution":{"iopub.execute_input":"2022-01-10T10:32:57.835461Z","iopub.status.busy":"2022-01-10T10:32:57.768532Z","iopub.status.idle":"2022-01-10T10:32:58.393621Z","shell.execute_reply":"2022-01-10T10:32:58.391725Z"},"papermill":{"duration":0.754797,"end_time":"2022-01-10T10:32:58.393767","exception":false,"start_time":"2022-01-10T10:32:57.63897","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[1mRows: \u001b[1m\u001b[22m\u001b[34m\u001b[34m940\u001b[34m\u001b[39m \u001b[1m\u001b[1mColumns: \u001b[1m\u001b[22m\u001b[34m\u001b[34m15\u001b[34m\u001b[39m\n","\n","\u001b[36m──\u001b[39m \u001b[1m\u001b[1mColumn specification\u001b[1m\u001b[22m \u001b[36m────────────────────────────────────────────────────────\u001b[39m\n","\u001b[1mDelimiter:\u001b[22m \",\"\n","\u001b[31mchr\u001b[39m  (1): ActivityDate\n","\u001b[32mdbl\u001b[39m (14