aes(x=total_minutes_asleep, y=total_time_in_bed)) + \n","  geom_point() + \n","  geom_smooth(method=\"loess\") + #Loess Regression to smoothen the volatile time series. \n","  labs(title = \"Total minutes asleep vs Total time in bed\", x=\"Total minutes asleep\", y=\"Total time in bed\") +\n","  stat_cor(method = \"pearson\", label.x = 600, label.y = 300) #add correlation coefficient and p-value to an empty space on the plot"]},{"cell_type":"markdown","id":"f85cc68d","metadata":{"papermill":{"duration":0.200567,"end_time":"2022-01-10T10:33:16.849526","exception":false,"start_time":"2022-01-10T10:33:16.648959","status":"completed"},"tags":[]},"source":["As predicted, there is a strong positive linear relationship between time in bed and time asleep (correlation coefficient is 0.93), however it is not perfect (a perfect positive correlation would be +1 ) and users spend some time awake in bed. The small p value (2.2x10^-16) that is <0.05 is an indicator of the relationship being statistically significant. \n","\n","According to a publication by the National Heart, Lung, and Blood Institute (NHLBI) <https://www.nhlbi.nih.gov/health-topics/all-publications-and-resources/your-guide-healthy-sleep>, it is recommended to not lie in bed awake more than 20 minutes without sleeping, and to get up and do some relaxing activity until you feel sleepy. The anxiety of not being able to sleep can make it harder to fall asleep.\n","This could be a marketable feature added to the Bellabeat fitness trackers, such as a reminder to the user when the user has spent too much time in bed not being asleep.\n"]},{"cell_type":"markdown","id":"02c2ad39","metadata":{"papermill":{"duration":0.201998,"end_time":"2022-01-10T10:33:17.252801","exception":false,"start_time":"2022-01-10T10:33:17.050803","status":"completed"},"tags":[]},"source":["### 4.7 Time asleep vs Total distance tracked<a class=\"anchor\" id=\"time_asleep_total_distance_4_7\"></a>"]},{"cell_type":"code","execution_count":18,"id":"