ess\") +\n","  labs(title = \"Calories vs Steps taken each day\", x=\"Calories expended\", y=\"Total number of steps\") +\n","  stat_cor(method = \"pearson\", label.x = 1000, label.y = 30000)"]},{"cell_type":"markdown","id":"d39b9104","metadata":{"papermill":{"duration":0.214893,"end_time":"2022-01-10T10:33:20.315188","exception":false,"start_time":"2022-01-10T10:33:20.100295","status":"completed"},"tags":[]},"source":["Monday and Sunday has the lowest calories expended, while Tuesday has the highest. This is in line with our previous observations for lowest and highest total steps each day."]},{"cell_type":"markdown","id":"a99ed708","metadata":{"papermill":{"duration":0.215089,"end_time":"2022-01-10T10:33:20.746285","exception":false,"start_time":"2022-01-10T10:33:20.531196","status":"completed"},"tags":[]},"source":["# <span style=\"color:#FA8072\"> 5. Act phase </span> <a class=\"anchor\" id=\"act_phase_5\"></a>\n","\n","### 5.1 Key recommendations <a class=\"anchor\" id=\"key_recommendations_5_1\"></a>\n","1. Healthy living goals with incentives in Bellabeat app.\n","   * From the analyses on daily activity, the users do not meet the recommended daily requirements for daily steps and sedentary days significantly outnumber the other activity categories. This is a point to focus on for Bellabeat marketing of their smart devices, since it markets itself to be the \"go-to wellness brand for women with an ecosystem of products and services focused on women’s health\" according to its website.\n","   * For example, Bellabeat can collaborate with other companies for their users to gain incentives in the form of discount vouchers when they hit specific goals. They can aim to work with other companies that promote healthy living such as those selling organic food, health supplements etc. The previous findings of positive correlations between calories expended vs total steps taken can be used in evidence-based messages in the app as well.\n","   * As previously mentioned, there could also be a incentive to minimise time spent awake in bed, to promote healthy sleep habits for better wellness.\n","   \n","   \n","2. Tracking healthy living progress over time\n","   * In addition to the previous concept of health goals with incentives, the Bellabeat app can also include a daily or weekly progress report. The report would compare the user activity level and other metrics between each day and week, with additional stacking incentives for constant progress. The previous analysis showed that the users were inconsistent in meeting recommended activity and sleep quality throughout the week, this could be another selling point for Bellabeat as enabling the user to improve their health and wellness with positive reinforcement.\n","   * This functionality could be integrated into the Bellabeat subscription program which already gives guidance on personal health and wellness. This would increase the appeal of it and encourage user retention to maintain their goal tracking.\n","\n","The Leaf product is Bellabeat's classic health tracker, adding the functions above to it might raise awareness of it and improve sales and brand recognition.\n","\n","### 5.2 Limitations of analysis <a class=\"anchor\" id=\"limitations_analysis_5_2\"></a>\n","* The analysis in this case study only uses daily data for activity and sleep, due to limitations in the remainder of the dataset.\n","* For the other variables not used in the daily activity file, we could not make any other meaningful conclusions.\n","* As previously mentioned, we could not find other useful datasets with larger sample sizes or more demographic data that could aid with analyses. Reproductive data such as menstrual cycle tracking would be most useful considering Bellabeat targets women for a customer base.\n","\n","### 5.3 Considerations for future analysis <a class=\"anchor\" id=\"considerations_future_5_3\"></a>\n","* This case study is an academic one with limited resources and no real relationship with Bellabeat, if there could be an opportunity to work directly with the company the analysis could be taken to another level.\n","* If a freely available dataset with more data such as on menstrual cycle tracking is available in the future, it would be interesting to revisit and explore this case study further.\n","\n","\n","Thank you for reading."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":84.489447,"end_time":"2022-01-10T10:33:21.071522","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-01-10T10:31:56.582075","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}